import React from "react";

const Logo = () => {
  return (
    <div className="m-10 gap-7 grid grid-cols-2 right-10">
      <div>
        <img className="w-3/4 h-20" src={"/assets/apf.png"} alt="" />
        <img className="w-3/4 h-20" src={"/assets/socianova.png"} alt="" />
      </div>
    </div>
  );
};

export default Logo;
